import React from 'react';
import './News.styles.css';

function News() {
    return (
        <div className='news_container'>
            <div className='header_news'>
                <h1 classname='last'>LAST</h1>
                <h1 classname='news'>NEWS</h1>
            </div>
        </div>
    );
}

export default News
